import React from "react";
import {Route, Switch, Redirect} from "react-router";
import {LoginPage} from "./app/pages/LoginPage";
import {HomePage} from "./app/pages/HomePage";
import {NavBar} from "./app/components/ui/NavBar";
import {NavLink} from "react-router-dom";
import {SiteMenu} from './app/components/ui/SiteMenu';
import {PageContent} from './app/components/ui/PageContent';
import {TitleBlock} from './app/components/ui/TitleBlock';
import {SiteContent} from './app/components/ui/SiteContent';

const NotFound = () => (
  <div>
    Page not found
  </div>
);

export const App = () => (
        <div className="homePage">
            <NavBar>
                <NavLink to="/calculator">Calculator</NavLink>
            </NavBar>
          <SiteContent>
            <SiteMenu>woot</SiteMenu>

          </SiteContent>
            <Switch>
                <Redirect from="/" to="/calculator"/>
                <Route path="/login" component={LoginPage}/>
                <Route path="/calculator" component={HomePage}/>
                <Route path="/" component={NotFound}/>
            </Switch>
        </div>

);
